              <Navigate to="/login" replace />
            ) : role === "admin" ? (
              <Navigate to="/admin" replace />
            ) : (
              <Navigate to="/user" replace />
            )
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
